import './App.css';
import { useState, useEffect } from 'react';
import TopicList from './components/TopicList'

function App() {

  const [topics, setTopics] = useState([])

  useEffect(()=> {
    fetch('http://localhost:3001/topics')
    .then(result => result.json())
    .then(topics => setTopics(topics))
  }, [])

  return (
    <div>
    <TopicList />
    </div>
  );
}

export default App;
